Frank Tupelo is een Amerikaanse toerist, die in Europa gemoedsrust probeert te vinden. Maar dan raakt hij verstrikt in een web van samenzweringen en leugens van Elise, een Interpolagent. Elise zit echter achter een crimineel aan met wie ze in het verleden een liefdesrelatie had.

